een zeer goeie film

met Shia LaBeouf, Megan Fox en Josh Duhamel

Heel lang geleden was er een oorlog op de planeet Cybertron, tussen de Autobots en de Decepticons. Vele jaren later, op de 
planeet Aarde, koopt de jonge Sam Witwicky zijn eerste auto en komt tot de ontdekking dat het de Autobot Bumblebee is. Deze is er 
om Sam te beschermen, aangezien Bumblebee niet de enige Transformer is die op Aarde is gekomen. Ook de Decepticons zijn op Aarde 
en beginnen het Amerikaanse leger aan te vallen. Als Sam en zijn vriendin Mikaela dan ontdekken dat het leger van plan is zowel 
de vijandige Decepticons als de vredelievende Autobots te vernietigen, proberen ze een nieuw plan te bedenken om de Decepticons 
